	add("habilitation", "{\"term\":\"habilitation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin \u0027habilitatio\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Equipment; qualification\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An act of habilitating\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An academic qualification, prerequiring a PhD, required in order to gain tenure as a professor in some European universities; a thesis or dissertation presented to achieve the qualification\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Robert J. Dostal, \u0027The Experience of Truth for Gadamer and Heidegger: Taking Time and Sudden Lightning\u0027, Brice Wachterhauser (editor), \u0027Hermeneutics and Truth\u0027, [http://books.google.com.au/books?id\u003d4H8g68lFd-sC\u0026amp;pg\u003dPA60\u0026amp;dq\u003d%22habilitation%22%7C%22habilitations%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dKFD-UaevLsOhkQXq24CwCA\u0026amp;redir_esc\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22habilitation%22%7C%22habilitations%22\u0026amp;f\u003dfalse page 60\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"At this same time Gadamer was at work on his \u0027\u0027habilitation\u0027\u0027 with Heidegger. His \u0027\u0027habilitation\u0027\u0027, \u0027Plato\u0027s Dialectical Ethics\u0027, concerned Plato\u0027s understanding of the good, and its two leading concepts were dialogue and dialectic\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, w:Pope Benedict Joseph Ratzinger, \u0027Milestones: Memoirs, 1927-1977\u0027, [http://books.google.com.au/books?id\u003d981K4YqNzpAC\u0026amp;pg\u003dPT104\u0026amp;dq\u003d%22habilitation%22%7C%22habilitations%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dKFD-UaevLsOhkQXq24CwCA\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22habilitation%22%7C%22habilitations%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"For one year it had been occupied by Otfried Müller, a priest from Silesia, who was trying simultaneously to advance the work for his \u0027\u0027\u0027habilitation\u0027\u0027\u0027—truly a difficult undertaking, considering the demands of teaching two core theological courses\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"1999\u0027\u0027, Robin D. Rollinger, \u0027Husserl\u0027s Position in the School of Brentano\u0027, [http://books.google.com.au/books?id\u003dIN8ivmMaGHQC\u0026amp;pg\u003dPA139\u0026amp;dq\u003d%22habilitation%22%7C%22habilitations%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dKFD-UaevLsOhkQXq24CwCA\u0026amp;redir_esc\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22habilitation%22%7C%22habilitations%22\u0026amp;f\u003dfalse page 139\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"In 1892 his\u0026lt;sup\u0026gt;\u0026lt;nowiki\u0026gt;[\u0026lt;/nowiki\u0026gt;w:Kazimierz Kazimierz Twardowski\u0027s\u0026lt;nowiki\u0026gt;]\u0026lt;/nowiki\u0026gt;\u0026lt;/sup\u0026gt; dissertation on Descartes, \u0027Idee und Perception\u0027, appeared and was followed in 1894 by his \u0027\u0027habilitation\u0027\u0027 thesis, \u0027Zur Lehre vom Inhalt und Gegenstand der Vorstellungen\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"2010\u0027\u0027, Peter Meusburger, Thomas Schuch, \u0027From Mediocrity and Existential Crisis to Scientific Excellence: Heidelberg University Between 1803 and 1932\u0027, Peter Meusburger, David N. Livingstone, Heike Jöns (editors), \u0027Geographies of Science\u0027, [http://books.google.com.au/books?id\u003dKWO5t7BXm50C\u0026amp;pg\u003dPA79\u0026amp;dq\u003d%22habilitation%22%7C%22habilitations%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dKFD-UaevLsOhkQXq24CwCA\u0026amp;redir_esc\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22habilitation%22%7C%22habilitations%22\u0026amp;f\u003dfalse page 79\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"In the period from 1803 to 1932 as a whole, professors of law were on average the youngest to complete their \u0027\u0027\u0027Habilitation\u0027\u0027\u0027 (28.5 years), trailed by theologians (29.8 years) and natural scientists (29.8 years\", \"priority\":15}]}, \"synonyms\":{}}");

