	add("haboku", "{\"term\":\"haboku\", \"etymology\":{\"influencers\":[], \"languages\":[\"mandarin chinese\", \"English\", \"Japanese\", \"late middle chinese\"], \"text\":\"From Japanese \u0027破墨\u0027 (tr\u003dhaboku \u0026lt;/i\u0026gt;はぼく\u0026lt;i\u0026gt;) from Late middle chinese 破 (\u0027pʰà\u0027 \u0026quot;broken up\u0026quot;) + 墨 (\u0027mok\u0027 \u0026quot;ink\u0026quot;) (compare Mandarin chinese \u0027pòmò\u0027 破墨, Cantonese \u0027po\u0026lt;sup\u0026gt;3\u0026lt;/sup\u0026gt;-mak\u0026lt;sup\u0026gt;6\u0026lt;/sup\u0026gt;\u0027 破墨).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A technique of using splashed ink in brushwork painting, especially for painting a landscape\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1979\u0027\u0027, John M. Rosenfield \u0026amp; William Jay Rathbun, \u0027Song of the Brush: Japanese paintings from the Sansō Collection\u0027, Seattle Art Museu\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027haboku\u0027\u0027 idiom had appeared in South China in the thirteenth century, and appealed greatly to visiting Japanese Zen Buddhists, who took examples back with them\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"2004\u0027\u0027, Benjamin Lee Wren, \u0027Teaching World Civilization With Joy and Enthusiasm\u0027, page 16\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"In the very year that the Void began in Kyoto, a Zen monk named Sesshu (1420-1506) left for Ming China and brought back to Japan \u0027\u0027\u0027haboku\u0027\u0027\u0027, or splash ink style and a love of wide open spaces in his paintings. \u0027\u0027\u0027Haboku\u0027\u0027\u0027 reached its zenith during the Muromachi Period (1470–1550) and then declined\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"2009\u0027\u0027, Fred S. Kleiner, \u0027Gardner\u0027s Art Through the Ages: Non-Western Perspectives\u0027, 13th edition, page 10\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"His most dramatic works are in the \u0027splashed-ink\u0027 (\u0027\u0027\u0027haboku\u0027\u0027\u0027) style, a technique with Chinese roots. The painter of a \u0027\u0027haboku\u0027\u0027 picture paused to visualize the image, loaded the brush with ink, and then applied primarily broad, rapid strokes, sometimes even dripping the ink onto the paper\", \"priority\":7}]}, \"synonyms\":{}}");

